// src/pages/admin/NotificationsPage.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const AdminNotificationsPage = () => {
  const navigate = useNavigate();
  const [stats, setStats] = useState({
    totalNotifications: 24,
    unreadNotifications: 8,
    maintenanceNotices: 5,
    paymentReminders: 3,
    securityAlerts: 2,
    communityEvents: 6
  });
  const [notifications, setNotifications] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const mockNotifications = [
      {
        id: 1,
        title: 'Elevator Maintenance',
        message: 'Scheduled for tomorrow 9AM-12PM',
        date: '25/10/2025',
        type: 'maintenance',
        read: false,
        priority: 'high'
      },
      {
        id: 2,
        title: 'Payment Due Reminder',
        message: 'Monthly maintenance fee due by Nov 5',
        date: '24/10/2025',
        type: 'payment',
        read: false,
        priority: 'medium'
      },
      {
        id: 3,
        title: 'Diwali Celebration',
        message: 'Community event on Oct 28 at 7PM',
        date: '23/10/2025',
        type: 'event',
        read: true,
        priority: 'low'
      },
      {
        id: 4,
        title: 'Security Update',
        message: 'New security protocols implemented',
        date: '22/10/2025',
        type: 'security',
        read: true,
        priority: 'high'
      },
      {
        id: 5,
        title: 'Water Supply Notice',
        message: 'Water supply will be interrupted tomorrow',
        date: '21/10/2025',
        type: 'maintenance',
        read: false,
        priority: 'high'
      }
    ];

    setTimeout(() => {
      setNotifications(mockNotifications);
      setLoading(false);
    }, 1000);
  }, []);

  const handleCreateNotification = () => {
    alert('创建新通知功能将在实际应用中实现');
  };

  const handleMarkAsRead = (id) => {
    setNotifications(notifications.map(notification =>
      notification.id === id ? { ...notification, read: true } : notification
    ));
  };

  const handleDeleteNotification = (id) => {
    setNotifications(notifications.filter(notification => notification.id !== id));
  };

  const getNotificationIcon = (type) => {
    switch(type) {
      case 'maintenance':
        return (
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#ff9800">
            <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M12,6A6,6 0 0,0 6,12A6,6 0 0,0 12,18A6,6 0 0,0 18,12A6,6 0 0,0 12,6M12,8A4,4 0 0,1 16,12A4,4 0 0,1 12,16A4,4 0 0,1 8,12A4,4 0 0,1 12,8Z"/>
          </svg>
        );
      case 'payment':
        return (
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#4caf50">
            <path d="M5,6H23V18H5V6M14,9A3,3 0 0,1 17,12A3,3 0 0,1 14,15A3,3 0 0,1 11,12A3,3 0 0,1 14,9M9,8A2,2 0 0,1 7,10V14A2,2 0 0,1 9,16H19A2,2 0 0,1 21,14V10A2,2 0 0,1 19,8H9M1,10H3V20H19V22H1V10Z"/>
          </svg>
        );
      case 'event':
        return (
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#e91e63">
            <path d="M19,3H18V1H16V3H8V1H6V3H5C3.89,3 3,3.9 3,5V19A2,2 0 0,0 5,21H19A2,2 0 0,0 21,19V5C21,3.9 20.1,3 19,3M19,19H5V8H19V19M7,10H12V15H7V10Z"/>
          </svg>
        );
      case 'security':
        return (
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#3f51b5">
            <path d="M12,1L3,5V11C3,16.55 6.84,21.74 12,23C17.16,21.74 21,16.55 21,11V5L12,1M12,7C13.4,7 14.8,8.6 14.8,10V11H16V16H8V11H9.2V10C9.2,8.6 10.6,7 12,7M12,8.2C11.2,8.2 10.4,8.7 10.4,10V11H13.6V10C13.6,8.7 12.8,8.2 12,8.2Z"/>
          </svg>
        );
      default:
        return (
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#607d8b">
            <path d="M13,13H11V7H13M13,17H11V15H13M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2Z"/>
          </svg>
        );
    }
  };

  const getPriorityBadge = (priority) => {
    const badges = {
      high: { class: 'high', text: 'HIGH' },
      medium: { class: 'medium', text: 'MEDIUM' },
      low: { class: 'low', text: 'LOW' }
    };
    return badges[priority] || badges.medium;
  };

  return (
    <div className="admin-notifications-page">
      <div className="page-header">
        <button className="back-btn" onClick={() => navigate('/admin')}>
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#333">
            <path d="M20,11V13H8L13.5,18.5L12.08,19.92L4.16,12L12.08,4.08L13.5,5.5L8,11H20Z"/>
          </svg>
          Back to Dashboard
        </button>
        <h1>Notifications Management</h1>
        <p>Manage all community notifications and announcements</p>
      </div>

      {loading ? (
        <div className="loading-container">
          <div className="spinner"></div>
        </div>
      ) : (
        <>
          <div className="stats-grid">
            <div className="stat-card primary">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M21,19V20H3V19L5,17V11C5,7.9 7.03,5.17 10,4.29C10,4.19 10,4.1 10,4A2,2 0 0,1 12,2A2,2 0 0,1 14,4C14,4.1 14,4.19 14,4.29C16.97,5.17 19,7.9 19,11V17L21,19M14,21A2,2 0 0,1 12,23A2,2 0 0,1 10,21"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Total Notifications</h3>
                <p className="stat-value">{stats.totalNotifications}</p>
              </div>
            </div>

            <div className="stat-card warning">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M13,13H11V7H13M13,17H11V15H13M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Unread</h3>
                <p className="stat-value">{stats.unreadNotifications}</p>
              </div>
            </div>

            <div className="stat-card info">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M12,2A10,10 0 0,0 2,12A10,10 0 0,0 12,22A10,10 0 0,0 22,12A10,10 0 0,0 12,2M12,4A8,8 0 0,1 20,12A8,8 0 0,1 12,20A8,8 0 0,1 4,12A8,8 0 0,1 12,4M12,6A6,6 0 0,0 6,12A6,6 0 0,0 12,18A6,6 0 0,0 18,12A6,6 0 0,0 12,6M12,8A4,4 0 0,1 16,12A4,4 0 0,1 12,16A4,4 0 0,1 8,12A4,4 0 0,1 12,8Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Maintenance Notices</h3>
                <p className="stat-value">{stats.maintenanceNotices}</p>
              </div>
            </div>

            <div className="stat-card success">
              <div className="stat-icon">
                <svg xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 24 24" fill="#fff">
                  <path d="M5,6H23V18H5V6M14,9A3,3 0 0,1 17,12A3,3 0 0,1 14,15A3,3 0 0,1 11,12A3,3 0 0,1 14,9M9,8A2,2 0 0,1 7,10V14A2,2 0 0,1 9,16H19A2,2 0 0,1 21,14V10A2,2 0 0,1 19,8H9M1,10H3V20H19V22H1V10Z"/>
                </svg>
              </div>
              <div className="stat-content">
                <h3>Payment Reminders</h3>
                <p className="stat-value">{stats.paymentReminders}</p>
              </div>
            </div>
          </div>

          <div className="page-actions">
            <button className="action-btn primary" onClick={handleCreateNotification}>
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                <path d="M19,13H13V19H11V13H5V11H11V5H13V11H19V13Z"/>
              </svg>
              Create New Notification
            </button>
            <button className="action-btn secondary">
              <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="#fff">
                <path d="M14,2H6A2,2 0 0,0 4,4V20A2,2 0 0,0 6,22H18A2,2 0 0,0 20,20V8L14,2M18,20H6V4H13V9H18V20M12,19L8,15H10.5V12H13.5V15H16L12,19Z"/>
              </svg>
              Export Notifications
            </button>
          </div>

          <div className="notifications-container">
            <div className="container-header">
              <h2>All Notifications</h2>
              <div className="filter-controls">
                <select className="filter-select">
                  <option>All Types</option>
                  <option>Maintenance</option>
                  <option>Payment</option>
                  <option>Event</option>
                  <option>Security</option>
                </select>
                <select className="filter-select">
                  <option>All Status</option>
                  <option>Read</option>
                  <option>Unread</option>
                </select>
              </div>
            </div>

            <div className="notifications-list">
              {notifications.map(notification => (
                <div key={notification.id} className={`notification-item ${notification.read ? 'read' : 'unread'}`}>
                  <div className="notification-icon">
                    {getNotificationIcon(notification.type)}
                  </div>
                  <div className="notification-content">
                    <div className="notification-header">
                      <h3>{notification.title}</h3>
                      <span className={`priority-badge ${getPriorityBadge(notification.priority).class}`}>
                        {getPriorityBadge(notification.priority).text}
                      </span>
                    </div>
                    <p>{notification.message}</p>
                    <div className="notification-footer">
                      <span className="notification-date">{notification.date}</span>
                      <div className="notification-actions">
                        {!notification.read && (
                          <button 
                            className="action-link"
                            onClick={() => handleMarkAsRead(notification.id)}
                          >
                            Mark as Read
                          </button>
                        )}
                        <button 
                          className="action-link delete"
                          onClick={() => handleDeleteNotification(notification.id)}
                        >
                          Delete
                        </button>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default AdminNotificationsPage;
